export default function HomeView() {
  return (
    <>
      {localStorage.getItem("auth") ? (
        <div className={style.contacts__area}>
          <div>
            <h3 className={style.newContact__title}>Create new contact</h3>
            <ContactForm
            // handleChange={handleChange}
