            <h3>Contacts</h3>
            <Filter
            // filterContacts={filterer}
            />
            <ContactList
            // filter={filter}
            // deleteContact={removeContact}
            />
          </div>
        </div>
      ) : (
        <h2 className={style.warning}>Please login first</h2>
      )}
    </>
  );
}
